import { useContext } from "react";
import Context from "../Context/Context";
import './index.css';
const Child=()=>{
    const {handleToggle}=useContext(Context)
   
    return(
        <div>
           <button onClick={handleToggle}>Toogle</button>
        </div>
    )
}
export default Child;
